  false,\n\t\"url\": null,\n\t\"notes\": \"While vegetation proved to be useful as
  a stress indicator, plants respond in different ways than mobile faunal species.
  Our study considered the response of wading birds and the aquatic macrofauna to
  the changing hydrology, water chemistry, and vegetation across the Loxahatchee landscape.
  Our research specifically addressed the following objectives: determine if wading
  birds differentially forage in certain habitats or regions of the study area more
  than others and the factors that influence these choices (e.g., water quality and
  quantity, vegetation, prey density); determine reproductive success of wading birds
  within the study area; determine the composition of aquatic macrofaunal assemblages
  across the mosaic of habitat types; relate various physicochemical (e.g., dissolved
  oxygen, pH, temperature, nutrients) and structural (e.g., plant species composition,
  canopy height, plant biomass) factors to variation in the composition of aquatic
  assemblages; relate gradients of water quality and hydroperiod to variation in the
  composition of aquatic assemblages; determine temporal and spatial variation in
  reproduction and recruitment for several numerically dominant aquatic taxa; and
  integrate various studies into the comprehensive GIS database.\",\n\t\"owner_org\":
